    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="ui segment">
                <div class="ui items">
                    <div class="item">
                        <div class="imgae">
                            <img src="" />
                        </div>
                        <div class="content">
                            <a class="header">Header</a>
                            <div class="meta">
                                <span>Description</span>
                            </div>
                            <div class="description">
                                <p></p>
                            </div>
                            <div class="extra">
                                Additional Details
                        </div>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default Grid;
